import { Main } from "govuk-react";
import { createContext } from "react";
import React, { useState } from "react";

import MyBtn from "../Components/Temp/MyBtn";
import MyInput from "../Components/Temp/MyInput";
import MyResponse from "../Components/Temp/MyResponse";

export const CurrentContext = createContext(null);

function Temp() {
  const [postcode, setPostcode] = useState("");
  const [forename, setForename] = useState("");

  function handleCallBack1(myPostcode) {
    setPostcode(myPostcode);
  
    CurrentContext.postcode = myPostcode;
  
  }

  function handleCallBack2(myForename) {
    setForename(myForename);
  
    CurrentContext.forename = myForename;
  
  }

  return (
    <>
      <Main>
        <h1>
          <MyInput />
          <br />
          <MyBtn callBack1={handleCallBack1} callBack2={handleCallBack2}  />
          <br />
          <MyResponse />
        </h1>
      </Main>
    </>
  );
}

export default Temp;
